import { BrowserRouter as Router, Switch, Route, Link } from "react-router-dom";
import CreateAccount from "./Pages/01_CreateAccount";

import "./App.css";

const Home = () => (
  <div className="App">
    <header className="App-header">
      <Link to="/about">Get started with Solana!</Link>
    </header>
  </div>
);

function App() {
  return (
    <Router>
      <Switch>
        <Route path="/">
          <Home />
        </Route>
        <Route path="/about">
          <CreateAccount />
        </Route>
      </Switch>
    </Router>
  );
}

export default App;
